import React, {Component} from 'react';


const Beans = ["Wet Beans", "Fermented Beans", "Unfermented Beans"]
const Process = ["Raw", "Roasting", "Winnowing", "Grinding"]

class RawMaterialOutput extends Component {
  render() {
    return (
      <div className="output-container">
        <div className="output_title">Current Inventory</div>
        <table className="raw-material-output-table" border="1">
          <tr bgcolor="#945600" style={{color: "white"}}>
            <td>Category</td>
            {Beans.map((category => 
              <td>{category}</td>
            ))}
          </tr>
          {Process.map((process => 
            <tr>
              <td bgcolor="#E09F3E">{process}</td>
              <td>0</td>
              <td>0</td>
              <td>0</td>
            </tr>
          ))}
          <tr>
            <td bgcolor="#CE8147">Total</td>
            <td bgcolor="#CE8147">0</td>
            <td bgcolor="#CE8147">0</td>
            <td bgcolor="#CE8147">0</td>
          </tr>
        </table>
      </div>

    )
  }
}

export default RawMaterialOutput;
